import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import { FaBehance, FaDribbble, FaInstagram, FaBars, FaTimes } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Blog from "./Blog";
import Contact from "./Contact";

const navigationItems = [
  { name: "Home", path: "/" },
  { name: "About", path: "/about" },
  { name: "Services", path: "/services" },
  { name: "Works", path: "/works" },
  { name: "Blog", path: "/blog" },
  { name: "Contact", path: "/contact" },
];

const socialLinks = [
  { icon: <FaBehance size={24} />, href: "https://behance.net/your-profile" },
  { icon: <FaDribbble size={24} />, href: "https://dribbble.com/your-profile" },
  { icon: <FaInstagram size={24} />, href: "https://instagram.com/your-profile" },
];

export default function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

  return (
    <Router>
      <div className="min-h-screen bg-gray-50 text-gray-900 flex flex-col md:flex-row">
        {/* Sidebar */}
        <aside
          className={`fixed inset-y-0 left-0 w-64 bg-gray-900 text-white p-6 transform transition-transform duration-300 ease-in-out z-50
            ${isMenuOpen ? "translate-x-0" : "-translate-x-full"} md:translate-x-0 md:static md:w-64 md:flex md:flex-col md:justify-between`}
        >
          <div>
            <div className="flex items-center justify-between">
              <h1 className="text-2xl font-semibold tracking-tight">Chiranjeevi</h1>
              <button className="md:hidden text-white" onClick={toggleMenu}>
                <FaTimes size={24} />
              </button>
            </div>
            <nav className="mt-10 space-y-4">
              {navigationItems.map((item) => (
                <NavLink
                  key={item.name}
                  to={item.path}
                  exact={item.path === "/"}
                  onClick={() => setIsMenuOpen(false)} // Close menu on link click (mobile)
                  className={({ isActive }) =>
                    `block text-gray-400 hover:text-white transition-colors duration-200 ${
                      isActive ? "text-white font-medium" : ""
                    }`
                  }
                >
                  {item.name}
                </NavLink>
              ))}
            </nav>
          </div>
          <div className="space-y-6">
            <div className="flex gap-6">
              {socialLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-400 hover:text-white transition-colors duration-200"
                >
                  {link.icon}
                </a>
              ))}
            </div>
            <p className="text-gray-500 text-xs">
              Â© {new Date().getFullYear()} Chiranjeevi Kumar. All rights reserved.
            </p>
          </div>
        </aside>

        {/* Mobile Menu Toggle Button */}
        <button
          className="fixed top-4 left-4 z-50 md:hidden p-2 text-gray-900 bg-white rounded-md shadow-md"
          onClick={toggleMenu}
        >
          {isMenuOpen ? null : <FaBars size={24} />}
        </button>

        {/* Overlay for Mobile Menu */}
        {isMenuOpen && (
          <div
            className="fixed inset-0 bg-black bg-opacity-50 z-40 md:hidden"
            onClick={toggleMenu}
          ></div>
        )}

        {/* Main Content */}
        <main className="flex-1 md:ml-64 p-4 sm:p-8 md:p-12 lg:p-16 overflow-y-auto">
          <Routes>
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/works" element={<Works />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}
